import withLayout from '../components/Layout';
import Content from '../components/Content';



const Blog = () => {
  return (
    <>
      <h1>My Blog</h1>
      <ul>
        <Content title='Hello Next.js' />
        <Content title='Learn Next.js is awesome' />
        <Content title='Deploy apps with Zeit' />
      </ul>
    </>
  )
} 

export default withLayout(Blog);
